import "../css/home.css";
import "../css/leftSide.css";
import "../css/rightSide.css";

function Home() {
  var areaCovered = "Area 6";

  var editToggle = "Edit";
  var viewingEditingToggle = "Viewing";
  var saveButton = "Save";

  if (editingMode == true) {
    editToggle = "View";
    viewingEditingToggle = "Editing";
    saveButton = "Save";
  } else {
    editToggle = "Edit";
    viewingEditingToggle = "Viewing";
  }

  return (
    <div class="toolContainer">
      <div class="leftSide">
        <div class="leftHeader">
          <h2>Circuits for {areaCovered}</h2>
        </div>
        <div class="leftBody">
          <div class="spreadsheet"></div>
        </div>
        <div class="leftFooter">
          <h3>{editToggle}</h3>
          <h4>- {viewingEditingToggle} -</h4>
          <h3>{saveButton}</h3>
        </div>
      </div>
      <div class="rightSide"></div>
    </div>
  );
}

export default Home;
